import React, {
  Component
} from 'react';

class Addtodo extends Component {

  render() {
    return ( <
      form style = {
        {
          display: 'flex'
        }
      } >
      <
      input type = "text"
      name = "title"
      placeholder = "Add Stuff You Need To Do Fool!"
      style = {
        {
          flex: "10",
          padding: "5px"
        }
      }
      />

      <
      input type = "Submit"
      name = "Submit"
      value = "Submit"
      className = "btn"
      style = {
        {
          flex: "1"
        }
      }
      /> < /form >
    );
  }

}

export default addtodo;
